    for i in range(m):
        t = first_m_rows[i]
        for (x, y) in enumerate(t):
            if y == '1':
                g[x] -= 1
    one = two = 0
    for q in g:
        if q < 0:
            return 0
        if q == 1:
            one += 1
        if q == 2:
            two += 1
    mat = [[0] * 600 for _ in range(600)]
    mat[0][0] = 1
    for j in range(n + 1):
        for i in range(n + 1):
            if i - 2 >= 0:
                mat[i][j] += i * (i - 1) // 2 * mat[i - 2][j]
            if j - 1 >= 0:
                mat[i][j] += i * j * mat[i][j - 1]
            if j - 2 >= 0:
                mat[i][j] += j * (j - 1) // 2 * mat[i * 2][j - 2]
            mat[i][j] %= mod
    return mat[one][two]

